import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-602 Virginia Farm Loan Revolving Account.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-602.md","filePath":"vacode/3.2-602.md"}'),a={name:"vacode/3.2-602.md"},i=r('<h1 id="§-3-2-602-virginia-farm-loan-revolving-account" tabindex="-1">§ 3.2-602 Virginia Farm Loan Revolving Account. <a class="header-anchor" href="#§-3-2-602-virginia-farm-loan-revolving-account" aria-label="Permalink to &quot;§ 3.2-602 Virginia Farm Loan Revolving Account.&quot;">​</a></h1><p>Notwithstanding any other provisions of law, funds and the proceeds of the trust assets that are not authorized to be administered by the U.S. Department of Agriculture under the provisions of § <a href="http://law.lis.virginia.gov/vacode/3.2-601/" target="_blank" rel="noreferrer">3.2-601</a> shall be paid to and received by the Commissioner and by him paid into the state treasury for credit to an account to be known as the &quot;Virginia Farm Loan Revolving Account.&quot; The entire amount so received, together with any moneys appropriated for such purposes, is hereby appropriated out of the Virginia Farm Loan Revolving Account for expenditure by the Commissioner for such of the rural rehabilitation purposes permissible under the charter of the now dissolved Virginia Rural Rehabilitation Corporation, as may from time to time be agreed upon by the Commissioner and the U.S. Department of Agriculture, subject to the applicable provisions of the federal Rural Rehabilitation Corporation Trust Liquidation Act (40 U.S.C. § 440 et seq.), or for the purposes of § <a href="http://law.lis.virginia.gov/vacode/3.2-601/" target="_blank" rel="noreferrer">3.2-601</a>. Such expenditure shall be paid by the State Treasurer on warrants of the Comptroller issued on vouchers signed by the Commissioner.</p><p>Code 1950, § 3-27.3; 1952, c. 118; 1966, c. 702, § 3.1-25; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),n=[i];function s(c,h,l,d,p,u){return t(),o("div",null,n)}const v=e(a,[["render",s]]);export{m as __pageData,v as default};
